import React from 'react';
import heroImage from '../../../assets/images/hero.svg';

const Hero = () => {
    return (
        <div className="home-header-container-hero">
            <div className="home-header-container-hero__left">
                <h1>Find The Job</h1>
                <h1>That's Fits your life</h1>
                <p>
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque, eius, provident voluptate laborum nobis omnis saepe facilis nulla autem velit pariatur ipsam quibusdam molestias animi.
                </p>
                <div className="home-header-container-hero__left-search">
                    <input type="text" className="home-header-container-hero__left-search__form" placeholder="Find your desired job"/>
                    <span className="">
                        <i className='fa fa-search'/>
                    </span>
                </div>
            </div>
            <div className="home-header-container-hero__right">
                <img src={heroImage} alt="hero img" />
            </div>
        </div>
    );
};

export default Hero;
